def find_majority(arr):
    maj_index = 0
    count = 1
    for i in range(len(arr)):
        if arr[maj_index] == arr[i]:
            count += 1
        else:
            count -= 1
        if count == 0:
            maj_index = i
            count = 1
    return arr[maj_index]

def is_majority(arr, cand):
    count = sum(1 for i in arr if i == cand)
    return count > len(arr)/2

def boyer_moore_voting(arr):
    majority = find_majority(arr)
    if is_majority(arr, majority):
        return majority
    else:
        return None
