def top_two_frequent_elements(arr):
    # ঘটনা গণনা করার জন্য একটি ডিকশনারি তৈরি করুন
    count_dict = {}
    for num in arr:
        if num in count_dict:
            count_dict[num] += 1
        else:
            count_dict[num] = 1

    # সবচেয়ে বেশি ঘটনার দুটি উপাদান খুঁজে পেতে ডিকশনারিটি ট্রাভার্স করুন
    first_max = [None, 0]
    second_max = [None, 0]
    for num, count in count_dict.items():
        if count > first_max[1]:
            second_max = first_max
            first_max = [num, count]
        elif count > second_max[1]:
            second_max = [num, count]

    return first_max[0], second_max[0]
```

