def merge_sort(lst):
    if len(lst) <= 1:
        return lst

    mid = len(lst) // 2
    left_list = merge_sort(lst[:mid])
    right_list = merge_sort(lst[mid:])

    return merge(left_list, right_list)

def merge(left, right):
    sorted_list = []
    left_index = 0
    right_index = 0

    while left_index < len(left) and right_index < len(right):
        if left[left_index] <= right[right_index]:
            sorted_list.append(left[left_index])
            left_index += 1
        else:
            sorted_list.append(right[right_index])
            right_index += 1

    while left_index < len(left):
        sorted_list.append(left[left_index])
        left_index += 1

    while right_index < len(right):
        sorted_list.append(right[right_index])
        right_index += 1

    return sorted_list
```

এই এলগরিদমটি প্রথমে তালিকাটি দুটি সমান অংশে বিভাজন করে এবং তারপর প্রতিটি অংশ স্বতন্ত্রভাবে সাজানো হয়। এরপর, এটি সাজানো অংশগুলি মার্জ করে একটি সাজানো তালিকা তৈরি করে।

